import { useContext, useEffect, useState } from "react";
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import AppBar from '@mui/material/AppBar';
import { Toolbar } from "@mui/material";
import Grid from '@mui/material/Grid';




const axios = require('axios')




function Home(userDetails) {

	const user = userDetails.user;
	const [img, setImg] = useState({})

	const logout = () => {
		window.open(`http://localhost:8080/auth/logout`, "_self");
	};

	const picOfDay = async () => {

		//e.preventDefault();

		const API_KEY = "DPYKShDqOt0azgbgT3qogu4s4GMb1Tx3NMatW8gZ";

		const {data: imageData} = await axios.get(`https://api.nasa.gov/planetary/apod?api_key=${API_KEY}`)

		//console.log(imageData)
		setImg(imageData) 

	}

	useEffect(() => {
		picOfDay();
	}, []);

	console.log(img.url)



	return (
		<div >

<AppBar position="fixed">
            <Toolbar>
            <Typography variant="h6" noWrap component="div">
              Welcome!
            </Typography>

            </Toolbar>

          </AppBar>
			<h1 >Home</h1>
			<div >
				<div >
				</div>
				<div >
					<h2 >Profile</h2>
					<img
						src={user.picture}
						alt="profile"

					/>
					<input
						type="text"
						defaultValue={user.name}

						placeholder="UserName"
					/>
					<input
						type="text"
						defaultValue={user.email}

						placeholder="Email"
					/>
					<button  onClick={logout}>
						Log Out
					</button>
				</div>

				<div>
						<img width="300" height="100"  src={img.url} className="img-fluid" />
					</div>
			</div>
		</div>
	);
}

export default Home;
